import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import emailjs from '@emailjs/browser';
import useScrollReveal from '../hooks/useScrollReveal';

export default function Contact() {
  useScrollReveal();

  const [submitted, setSubmitted] = useState(false);
  const [loading, setLoading] = useState(false);

  const [form, setForm] = useState({
    name: '',
    company: '',
    email: '',
    phone: '',
    product: '',
    message: ''
  });

  const handleChange = (e) =>
    setForm((f) => ({ ...f, [e.target.name]: e.target.value }));

  const handleSubmit = (e) => {
    e.preventDefault();
    setLoading(true);

    emailjs
      .send(
        "YOUR_SERVICE_ID",     // ðŸ”¹ Replace
        "YOUR_TEMPLATE_ID",    // ðŸ”¹ Replace
        {
          from_name: form.name,
          company: form.company,
          email: form.email,
          phone: form.phone,
          product: form.product,
          message: form.message,
        },
        "YOUR_PUBLIC_KEY"      // ðŸ”¹ Replace
      )
      .then(() => {
        setLoading(false);
        setSubmitted(true);
      })
      .catch((error) => {
        setLoading(false);
        console.error("Email send error:", error);
        alert("Something went wrong. Please try again.");
      });
  };

  return (
    <div className="page-enter">
      <div className="page-hero">
        <div className="page-hero-inner">
          <div className="breadcrumb">
            <Link to="/" className="bc-home">
              Home
            </Link>
            <span className="bc-sep">â€º</span>
            <span className="bc-current">Contact</span>
          </div>

          <div
            className="section-eyebrow"
            style={{ color: "rgba(255,255,255,0.6)" }}
          >
            Reach Out
          </div>

          <h1
            className="section-title"
            style={{
              fontSize: "clamp(46px,7vw,84px)",
              color: "#fff",
              marginBottom: 18,
            }}
            dangerouslySetInnerHTML={{
              __html: 'Contact <span style="color:#3dd958">Us</span>',
            }}
          />

          <p
            className="section-sub"
            style={{ color: "rgba(255,255,255,0.82)", maxWidth: 520 }}
          >
            Ready to get started? Reach out for a custom quote or any product
            enquiry. We respond within 24 hours.
          </p>
        </div>
      </div>

      <section style={{ padding: "90px 60px", background: "#fff" }}>
        <div
          style={{
            maxWidth: 1280,
            margin: "0 auto",
            display: "grid",
            gridTemplateColumns: "1fr 1.35fr",
            gap: 88,
          }}
        >

          {/* FORM ONLY UPDATED BELOW */}

          <div
            style={{
              background: "#f4f4f2",
              borderRadius: 16,
              padding: "50px 46px",
              border: "1px solid #e4e4e2",
            }}
          >
            {submitted ? (
              <div style={{ textAlign: "center", padding: "60px 0" }}>
                <div style={{ fontSize: 72, marginBottom: 24 }}>âœ…</div>
                <h3
                  style={{
                    fontSize: 38,
                    fontWeight: 800,
                    textTransform: "uppercase",
                    marginBottom: 14,
                  }}
                >
                  Thank You!
                </h3>
                <p style={{ fontSize: 16, marginBottom: 32 }}>
                  Your enquiry has been received. Our team will get back to you
                  within 24 hours.
                </p>
              </div>
            ) : (
              <form onSubmit={handleSubmit}>
                <h3
                  style={{
                    fontSize: 32,
                    fontWeight: 800,
                    textTransform: "uppercase",
                    marginBottom: 30,
                  }}
                >
                  Request a Quote
                </h3>

                <div className="form-group">
                  <label>Full Name *</label>
                  <input
                    name="name"
                    value={form.name}
                    onChange={handleChange}
                    type="text"
                    required
                  />
                </div>

                <div className="form-group">
                  <label>Email *</label>
                  <input
                    name="email"
                    value={form.email}
                    onChange={handleChange}
                    type="email"
                    required
                  />
                </div>

                <div className="form-group">
                  <label>Message *</label>
                  <textarea
                    name="message"
                    value={form.message}
                    onChange={handleChange}
                    required
                  />
                </div>

                <button
                  type="submit"
                  className="btn-green"
                  style={{
                    width: "100%",
                    padding: "14px",
                    marginTop: 10,
                  }}
                  disabled={loading}
                >
                  {loading ? "Sending..." : "Send Enquiry â†’"}
                </button>
              </form>
            )}
          </div>

        </div>
      </section>
    </div>
  );
}
